import './App.css';
function App() {
  return (
    <div className="App">
      <header className="header">
        <div className='container'>
          <div>
            <a href="http://localhost:3000/">
              <img src="juejin.svg" alt="掘金" />
            </a>
          </div>
          <div className='menu'>
            <span>首页</span>
          </div>
        </div>

      </header>
    </div>
  );
}

export default App;
